import React from 'react';

const ContestsCard: React.FC = () => {
  return (
    <div className="bg-orange-100 p-6 rounded-2xl shadow-lg w-full h-full">
      <h2 className="text-xl font-bold mb-4">Contests</h2>
      <p className="text-gray-700">Explore free competitions, showcase your skills & win rewards</p>
    </div>
  );
};

export default ContestsCard;
